import React, { useEffect, useState } from "react";
import { useRouter } from "next/router";
import { useDispatch } from "react-redux";
import { Typography, Row, Col } from "antd";
import { useSelector } from "react-redux";
const { Text } = Typography;

import { ADD_URL } from "../reducers/answer";
import { MAKE_DIRECT_FALSE } from "../reducers/answer";

import db from "../back/firestore";
import storage from "../back/cloudStorage";
import { v4 as uuid } from "uuid";
import calculator from "../back/calculator";
import result from "../assets/result.json";

import { WidthDiv } from "../assets/css/style_result";
import { Spinner } from "react-activity";

const Loading = () => {
	const router = useRouter();
	const dispatch = useDispatch();
	const { ans } = useSelector((state) => state.answer);
	const { url } = useSelector((state) => state.answer);

	const [screenshotUrl, setScreenshotUrl] = useState(null);
	const [thumbUrl, setThumbUrl] = useState(null);
	const [goodUrl, setGoodUrl] = useState(null);
	const [badUrl, setBadUrl] = useState(null);
	const [ready, setReady] = useState(false);

	const [v, setV] = useState(null);

	useEffect(() => {
		if (ans) {
			console.log("ans is ", ans);
			setV(result[calculator(ans)]);

			const now = new Date();
			const uid = uuid();

			const userObj = {
				answer: ans,
				type: calculator(ans),
				created_at: now,
				updated_at: now,
			};

			db.collection("results")
				.doc(uid)
				.set(userObj)
				.then((res) => {})
				.catch((error) => {
					//alert("error: " + error.message);
					console.log(error);
				});
		} else {
			router.push("/result/".concat(calculator([])));
		}
	}, [ans]);

	useEffect(() => {
		if (v) {
			storage
				.ref()
				.child(v["screenshot"])
				.getDownloadURL()
				.then((url) => {
					setScreenshotUrl(url);
				})
				.catch((err) => {
					return;
				});

			storage
				.ref()
				.child(v["thumbnail"])
				.getDownloadURL()
				.then((url) => {
					setThumbUrl(url);
				})
				.catch((err) => {
					return;
				});

			storage
				.ref()
				.child(result[v["good"]]["thumbnail"])
				.getDownloadURL()
				.then((url) => {
					setGoodUrl(url);
				})
				.catch((err) => {
					return;
				});

			storage
				.ref()
				.child(result[v["bad"]]["thumbnail"])
				.getDownloadURL()
				.then((url) => {
					setBadUrl(url);
				})
				.catch((err) => {
					return;
				});
		}
	}, [v]);

	useEffect(() => {
		if (screenshotUrl && thumbUrl && goodUrl && badUrl) {
			dispatch({
				type: ADD_URL,
				data: {
					screenshotUrl: screenshotUrl,
					thumbUrl: thumbUrl,
					goodUrl: goodUrl,
					badUrl: badUrl,
				},
			});
		}
	}, [screenshotUrl, thumbUrl, goodUrl, badUrl]);

	useEffect(() => {
		dispatch({
			type: MAKE_DIRECT_FALSE,
		});
		setReady(true);
	}, [url["badUrl"]]);

	if (typeof window !== "undefined") {
		function checkReady() {
			if (ready == false) {
				window.setTimeout(checkReady, 500);
				console.log("tick tock");
			} else {
				console.log("thumbUrl is ", thumbUrl);
				console.log("goodUrl is ", goodUrl);
				console.log("badUrl is ", badUrl);

				router.push("/result/".concat(calculator(ans)));
				setReady(false);
			}
		}
		checkReady();
	}

	return (
		<>
			<Row justify="center">
				<Col xs={16} sm={14} md={10} lg={8} xl={8}>
					<WidthDiv>
						<Spinner />
					</WidthDiv>
				</Col>
			</Row>
			<Row justify="center">
				<Col xs={16} sm={14} md={10} lg={8} xl={8}>
					<Text
						style={{
							textAlign: "center",
							display: "block",
							marginTop: "30px",
							fontSize: "20px",
						}}
					>
						분석중..
					</Text>
				</Col>
			</Row>
		</>
	);
};

export default Loading;
